import { useHistory } from "react-router-dom";

function Model(props) {
    let history = useHistory();
    const handleSubmit = (e) => {
        
        e.preventDefault();
        console.log(e.target.name)
        console.log(typeof(e.target.name))
        fetch('http://localhost:8000/api/home',{
            method: 'DELETE',
            body: {
                "_id":e.target.name
            }
        }).then( async (response) => {
            let res = response;
            console.log(res);
        });
        history.push("/");

    }
    if(props.props._id){
        return(
            <div className="Model">
                <form onSubmit={handleSubmit} name = {props.props._id}>
                    <div class="card">
                        <div className="card-body">
                                <ul class="list-group list-group-flush">
                                    {props.props.state && <li class="list-group-item card-text">{props.props.state}</li>}
                                    {props.props.date && <li class="list-group-item card-text">{props.props.date}</li>}
                                    {props.props.cases && <li class="list-group-item card-text">{props.props.cases}</li>}
                                    {props.props.deaths && <li class="list-group-item card-text">{props.props.deaths}</li>}
                                </ul>
                        </div>
                        <div className="card-body">
                            <button className="btn btn-danger">Delete</button>
                        </div>
                    </div>
                    
                </form>
            </div>
        )
    }
    
   
}
export default Model;
